"(function() {
    var originalConsoleLog = console.log;
    var originalConsoleError = console.error;

    console.log = function(message) {
        window.webkit.messageHandlers.logConsoleMessages.postMessage("LOG: " + message);
        originalConsoleLog.apply(console, arguments);
    };

    console.error = function(message) {
        window.webkit.messageHandlers.logConsoleMessages.postMessage("ERROR: " + message);
        originalConsoleError.apply(console, arguments);
    };

    window.addEventListener("error", function(event) {
        window.webkit.messageHandlers.logConsoleMessages.postMessage("JS ERROR: " + event.message + " at " + event.filename + ":" + event.lineno);
    });

    var open = XMLHttpRequest.prototype.open;
    XMLHttpRequest.prototype.open = function(method, url) {
        window.webkit.messageHandlers.logConsoleMessages.postMessage("XHR: " + method + " " + url);
        return open.apply(this, arguments);
    };
})();"
